import styled from 'styled-components';

const Container = styled.div`
	display: grid;
	width: 100%;
	grid-template-columns: 12px 12px 12px;
	grid-template-rows: 12px 12px 12px;
`;

const LogoStyle = styled.div`
	display: flex;
	img {
		height: 5rem;
		width: 5rem;
	}
`;

export { Container, LogoStyle };
